import React, { Component } from 'react';

import '../css/Buscador.css'

class Buscador extends Component {
    render() { 
        return (  
            <form className="buscador">
                <input type="text" placeholder="Busqueda"/>
            </form>
        );
    }
}

export default Buscador;
